Oferta dotyczy sprzedaży samochodu Opla Vectra C z 2004 roku



Wyposażenie:



* Instalacja Gazowa STAG, butla 56l, wlew schowany obok wlewu paliwa;

* Reflektory ksenonowe;

* Klimatyzacja dwustrefowa sprawna;

* ABS;

* Opony letnie na felgach aluminiowych + dodatkowy komplet zimowe opony + felgi stalowe;

* Szyby elektryczne przód;



W 2024 roku w silniku został wymieniony kompletny rozrząd z pompą wody.

Silnik prawidłowo pracuje na benzynie i na gazie , nie pobiera oleju, nie dymi. 



Przegląd do stycznia 2026

OC do końca lipca 2025



Zapraszam do obejrzenia

Witam

Mam do sprzedania Peugeot 207 1.4 HDI z 2008 roku. Po serwisie olejowym przy 295 tys. Km. i wszystkich filtrów. Rozrząd wymieniany 2 lata temu. Idealne auto na dojazdy do pracy. Jest bardzo oszczędne. Jego spalanie wynosi 4,5 l/100 km. Na pełnym zbiorniku można przejechać 1200 km. Długie opłaty: przegląd i OC do końca grudnia 2025. Pojazd jest dość dobrze wyposażony:



- światła halogenowe;



- elektryczne szyby;



- elektryczne podgrzewane luterka;



- klimatyzacja;



- komputer pokładowy;



- oryginalne radio CD + MP3 sterowanie w kierownicy; 



- 4 x airbag;



- ISOFIX;

i wiele innych o których możliwe, że nie napisałem.

Cena jaka mnie interesuje to 6900 zł. Jestem osobą prywatną, sprzedaż odbędzie się na umowę kupna-sprzedaży.



